﻿#include "leetcode.hpp"



class Solution
{
	int gcd(int a, int b)
	{
		int c;
		while (b)
		{
			c = a % b;
			a = b;
			b = c;
		}
		return a;
	}
public:
	string findLexSmallestString(string s, int a, int b)
	{
		string ans = s;
		string t = s + s;
		int n = static_cast<int>(s.size());
		int g = gcd(n, b);
		for (int i = 0; i < n; i += g)
		{

			for (int j = 0; j <= 9; ++j)
			{

				int k = g % 2 ? 9 : 0;
				for (; k >= 0; --k)
				{
					string q = t.substr(i, n);
					for (int m = 1; m < n; m += 2)
						q[m] = (char)((q[m] - '0' + a * j) % 10 + '0');
					for (int m = 0; m < n; m += 2)
						q[m] = (char)((q[m] - '0' + a * k) % 10 + '0');
					if (q < ans) ans.swap(q);
				}
			}
		}
		return ans;
	}
};
int main()
{
	Solution s;
	OutString(s.findLexSmallestString("5525", 9, 2));
	OutString(s.findLexSmallestString("74", 5, 1));
	OutString(s.findLexSmallestString("0011", 4, 2));
	OutString(s.findLexSmallestString("43987654", 7, 3));
},cpp

