UInt gcd(UInt a, UInt b) {
    if (b == 0) return a;
    return gcd(b, a % b);
}
UInt gcd2(UInt a, UInt b) {
    while (b != 0) {
        UInt oldB = b;
        b = a % b;
        a = oldB;
    }
    return a;
}
