auto escape(std::string const& s) -> std::string
{
  std::string escaped;
  escaped += '"';
  for (auto c : s) {
    if (c == '\\' || c == '"') {
      escaped += '\\';
    }
    escaped += c;
  }
  escaped += '"';
  return escaped;
}
