class Solution {
public:
    vector<int> twoSum(vector<int>& nums, int target) {
      std::vector<int> res;
      std::unordered_map<int, int> m;
      for (std::size_t i = 0; i < nums.size(); i++) {
        auto iter = m.find(nums[i]);
        if (iter == m.end()) {
          m[target-nums[i]] = i;
        } else {
          res.push_back(iter->second);
          res.push_back(i);
          return res;
        }
      }
    }
