class FuzzyAND extends FuzzyCompositeTerm {
	constructor() {
		const terms = Array.from(arguments);
		super(terms);
	}
	getDegreeOfMembership() {
		const terms = this.terms;
		let minDOM = Infinity;
		for (let i = 0, l = terms.length; i < l; i++) {
			const currentDOM = terms[i].getDegreeOfMembership();
