import java.util.Arrays;

public class ArrayUtils
{

	private ArrayUtils()
	{
	}

	public static <T> T[] shift(T[] array, int count)
	{
		int length = array.length;
		T[] res = Arrays.copyOf(array, length);
		if (count == 0)
		{
			return res;
		}
		for (int i = 0; i < length; i++)
		{
			int srcIdx = i - count;
			while (srcIdx < 0)
			{
				srcIdx += length;
			}
			while (srcIdx > (length - 1))
			{
				srcIdx -= length;
			}
			res[i] = array[srcIdx];
		}
		return res;
	}
},java

