func ActorIDFromHex(str string) *ActorID {
	if str == "" {
		return nil
	}
	actorID := ActorID{}
	decoded, err := hex.DecodeString(str)
	if err != nil {
		panic("fail to decode hex")
	}
	copy(actorID[:], decoded[:actorIDSize])
	return &actorID
}


func (id *ActorID) String() string {
	if id == nil {
		return ""
	}
	return hex.EncodeToString(id[:])
}



