func (tc *TestClient) Log() *log.Entry {
	return tc.logger
}
func (tc *TestClient) Read(p []byte) (n int, err error) {
	return tc.reader.Read(p)
}
func (tc *TestClient) Write(p []byte) (n int, err error) {
	return tc.output.Write(p)
