const friends = 2
type room struct {
	size     int
	capacity int
}






func taskSolution(a []room) (ans int) {
	for _, r := range a {
		if friends+r.size <= r.capacity {
			ans += 1
		}
	}
	return ans
}
func main() {
	var n int
	if _, err := fmt.Scan(&n); err != nil {
		panic(err)
