	a := []room{}
	for i := 0; i < n; i += 1 {
		var s, c int
		if _, err := fmt.Scan(&s, &c); err != nil {
			panic(err)
		}
		a = append(a, room{size: s, capacity: c})
	}
	fmt.Println(taskSolution(a))
