using namespace std;
int knapsack01(int *weight, int *prices, int n, int c)
{

    if (n == 0 || c == 0)
        return 0;

    int inc = 0, exc = 0;

    if (weight[n - 1] <= c)
        inc = prices[n - 1] + knapsack01(weight, prices, n - 1, c - weight[n - 1]);

    exc = knapsack01(weight, prices, n - 1, c);
    return max(inc, exc);
}
