using namespace std;
typedef long long Int;
typedef unsigned uint;
int N, K;
Int dp[12][20];
Int func(int digit, int len) {
	if (len == N) {
		return 1;
	} else {
		Int& ans = dp[digit][len];
		if (ans == -1LL) {
			ans = 0LL;
			for (int i = 0; i < K; i++) {
				if ((i == 0 && digit == 0) || (i == 0 && len == 0)) continue;
				ans = (ans + func(i, len + 1));
			}
		}
		return ans;
	}
}
int main(void) {
	scanf("%d%d", &N, &K);
	memset(dp, -1LL, sizeof(dp));
	printf("%lld\n", func(10, 0));
    return 0;
},cpp

