var varLock sync.Mutex




func ReportInt(ns, name string) VarInt {
	varName := ns + "." + name
	varLock.Lock()
	defer varLock.Unlock()
	if v := expvar.Get(varName); v != nil {
		return v.(*expvar.Int)
	}
	return expvar.NewInt(varName)
