func SelectionSort[T constraints.Ordered](nums []T) []T {

	for i := 0; i < len(nums); i++ {


		min := i

		for j := i + 1; j < len(nums); j++ {
			if nums[j] < nums[min] { //finds the minimum element
				min = j
			}
		}

		nums[i], nums[min] = nums[min], nums[i]
	}
	return nums
},go

