package leetcode
import "sort"
func findRadius(houses, heaters []int) int {
	sort.Ints(heaters)
	var radius int
	for _, house := range houses {
		i := findIndex(heaters, house)
		min := int(1e9)
		if i >= 0 {
			min = house - heaters[i]
		}
		if i+1 < len(heaters) && heaters[i+1]-house < min {
			min = heaters[i+1] - house
		}
		if min > radius {
			radius = min
		}
	}
	return radius
}
func findIndex(nums []int, num int) int {
	lo, hi := -1, len(nums)-1
	for lo < hi {
		mid := hi - (hi-lo)/2
		if nums[mid] < num {
			lo = mid
		} else if nums[mid] > num {
			hi = mid - 1
		} else {
			return mid
		}
	}
	return lo
},go

