long Factorial(int no)
{
long  fac = 1;
    for (int r=no; r >= 1; r--) {
        fac = fac * r;
    }
  return fac;
}
long nCr(int n, int r)
{
  long nCr=Factorial( n)/Factorial( r)*Factorial( n-r);
