int Solution::diffPossible(const vector<int> &A, int B) {
    vector<int> input(A);
    sort(input.begin(), input.end());
    auto p = 0, q = 0;
    auto size = input.size();
    while (q < size)
    {
        if (p == q)
            ++q;
        else if (input[q]-input[p] == B && p!=q)
            return 1;
        else if (input[q]-input[p] < B)
            ++q;
        else if (input[q]-input[p] > B)
            ++p;
    }
    return 0;
},cpp

